import LoginSignup from './UserLogin/LoginSignup';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" component={LoginSignup} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
